import { Component } from "react";

class Ingreso extends Component{
    render(){
        return(
            <div>
                <form>
                    Email: <input type='email'></input>
                    pass: <input type='password'></input>
                    <button>Ingresar</button>
                </form>
            </div>
        )
    }
}

export default Ingreso;
